      // }
    }
    const changeReturnType = (type)=>{
      store.commit('setReceiveType', type)
      showChangeBox.value = false
    }
    watch(() => question.value, (newValue, oldValue) => {
      if(!newValue){
        var e = inputContent.value
        var el = inputContentBox.value
        e.style.height = '0.5rem';
        el.style.height = '1rem';
      }
    })
    const microphoneTipsHandle = (type)=>{
      if(type == '1'){
        ElMessage({
          message: t('microphoneTips'),
          type: 'error',
        })		
      }else if(type == '2'){
        ElMessage({
          message: t('notSupportRecording'),
          type: 'error',
        })	
      }  
    }
    onMounted(() => {
      // initializeRecognition();
    });
    EventBus.$on('shareMultimedia', shareMultimedia)
    EventBus.$on('shareLink', shareLink)
    EventBus.$on('stopRecording', stopRecording)
    EventBus.$on('startRecording', startRecording)
    EventBus.$on('closeVectorHandle', closeVectorHandle)
    EventBus.$on('microphoneTipsHandle', microphoneTipsHandle)
    onUnmounted(() => {
      EventBus.$off('shareMultimedia', shareMultimedia)
      EventBus.$off('shareLink', shareLink)
      EventBus.$off('stopRecording', stopRecording)
      EventBus.$off('startRecording', startRecording)
      EventBus.$off('closeVectorHandle', closeVectorHandle)
      EventBus.$off('microphoneTipsHandle', microphoneTipsHandle)
    })
    return {
        question,
        sendMessage,
        loginStatus,
        focusHangle,
        screenWidth,
        selectStatus,
        shareLink,
        selectType,
        deleteChat,
        shareMultimedia,
        sharelink,
        moreShareDialog,
        showMoreShareDialog,
        closeMoreShareDialog,
        getUserPayAccount,
        userModel,
        haveCount,
        focusHandle,
        isVoice,
        recognition,
        startRecognition,
        stopRecognition,
        timeout,
        isRecognitionRunning,
        transcript,
        scrollToLeft,
        restartTimer,
        inputContent,
        inputContentBox,
        audioElement,
        prefix,
        isSentence,
        adjustTextareaHeight,
        navQueryType,
        fileToBase64Async,
        imgBase64,
        showPLUSTip,
        showImgTips,
        chatType,
        isRecording,
        mediaRecorder,
        audioChunks,
        audioData,
        startRecording,
        stopRecording,
        audioConvertBase64,
        audioBase64,
        receiveType,
        changeReturnType,
        showChangeBox,
        showAudioMaxBox,
        closeVectorHandle,
        gptAudio,
        pause,
        gptAudioLoading,
    } 
  },
  components: {
    moreShareMb,
  },
  created() {
    this.init()
  },
  methods: {
    closeHandle(){
      this.$store.commit('setSelectStatus', false)
    },
    init(){
      // clearInterval(this.timer)
      this.getUserPayAccount()
      // this.timer = setInterval(() => {
      //   this.getUserPayAccount()
      // }, 5000)
    },
    triggerFileInput(){
      if(this.userModel == '3.5'){
        this.showPLUSTip = true
        const self = this
        setTimeout(function(){
          self.showPLUSTip = false
        },3000)
        return
      }
      this.$refs.fileInput.value = '';
      this.$refs.fileInput.click(); // 模拟点击文件选择控件
      this.closeVectorHandle()
    },
    async handleFileChange(event) {
      this.showImgTips = false
      const file = event.target.files[0]; // 保存文件到组件的 data
      const allowedTypes = ['image/png', 'image/jpeg', 'image/jpg'];
      const isSupport = allowedTypes.includes(file.type);
      if (file && isSupport) {
        this.imgBase64 = await this.fileToBase64Async(file)
      } else {
        console.log('请选择有效的 PNG 或 JPEG 图片');
        ElMessage({
            message: this.$t('imgTypeTip'),
            type: 'error',
          })
      }

    },
    closeImgHandle(){
      this.$store.commit('setImgBase64', '')
    },
    imgTipShowHandle(){
      if(!this.imgBase64 && this.userModel == '4'){
        this.showImgTips = true
      }
    },
    imgTipHideHandle(){
      this.showImgTips = false
    },
    pauseAudio(){
      this.audioElement.pause();
      this.pause = true
    },
    payAudio(){
      this.audioElement.play();
      this.pause = false
    },
    handleAudioEnded(){
      this.$store.commit('setGptAudio', '')
      this.startRecording()
    }
  },
  mounted() {
   
  },
  unmounted() {
    clearInterval(this.timer)
  },
}
</script>

